---
components:
  responses:
    DataMissing:
      content:
        application/json:
          schema:
            properties:
              cause:
                example: Missing one or more fields [...]
                type: string
              success:
                example: false
                type: boolean
            type: object
      description: Some data is missing, this is usually a field.
    InvalidKey:
      content:
        application/json:
          schema:
            properties:
              cause:
                example: Invalid API key
                type: string
              success:
                example: false
                type: boolean
            type: object
      description: Access is forbidden, usually due to an invalid API key being used.
    InvalidPage:
      content:
        application/json:
          schema:
            properties:
              cause:
                example: Invalid page
                type: string
              success:
                example: false
                type: boolean
            type: object
      description: The page provided is invalid.
    MalformedData:
      content:
        application/json:
          schema:
            properties:
              cause:
                example: Malformed UUID
                type: string
              success:
                example: false
                type: boolean
            type: object
      description: Some data provided is invalid.
    MissingPage:
      content:
        application/json:
          schema:
            properties:
              cause:
                example: Page not found
                type: string
              success:
                example: false
                type: boolean
            type: object
      description: The page provided does not exist.
    NoResult:
      content:
        application/json:
          schema:
            properties:
              cause:
                example: No result was found
                type: string
              success:
                example: false
                type: boolean
            type: object
      description: The request responded with no result.
    NotPopulated:
      content:
        application/json:
          schema:
            properties:
              cause:
                example: Leaderboard data has not yet been populated
                type: string
              success:
                example: false
                type: boolean
            type: object
      description: The data is not yet populated and should be available shortly
    RateLimited:
      content:
        application/json:
          schema:
            properties:
              cause:
                example: Key throttle
                type: string
              global:
                description: When this boolean exists and is true, the throttle occurring is a global throttle applied to all users
                example: true
                type: boolean
              success:
                example: false
                type: boolean
              throttle:
                example: true
                type: boolean
            type: object
      description: A request limit has been reached, usually this is due to the limit on the key being reached but can also be triggered by a global throttle.
