info:
  contact:
    name: Hypixel Support
    url: https://developer.hypixel.net
  termsOfService: https://hypixel.net/tos
  title: Hypixel Public API
  version: v2
  x-logo:
    altText: Hypixel Logo
    href: '#'
    url: https://api.hypixel.net/assets/images/logo.png
openapi: 3.0.3
paths:
  /v2/skyblock/museum:
    get:
      description: SkyBlock museum data for all members of the provided profile. The data returned can differ depending on the players in-game API settings.
      parameters:
        - in: query
          name: profile
          schema:
            format: uuid
            type: string
      responses:
        '200':
          $ref: '#/components/responses/SkyBlockMuseumGet'
        '403':
          $ref: '#/components/responses/InvalidKey'
        '422':
          $ref: '#/components/responses/MalformedData'
        '429':
          $ref: '#/components/responses/RateLimited'
      security:
        - ApiKey: [ ]
      summary: Museum data by profile ID
      tags:
        - SkyBlock
  /v2/skyblock/news:
    get:
      responses:
        '200':
          $ref: '#/components/responses/SkyBlockNewsGet'
        '403':
          $ref: '#/components/responses/InvalidKey'
        '429':
          $ref: '#/components/responses/RateLimited'
      security:
        - ApiKey: [ ]
      tags:
        - SkyBlock
  /v2/skyblock/profile:
    get:
      parameters:
        - in: query
          name: profile
          schema:
            format: uuid
            type: string
      responses:
        '200':
          $ref: '#/components/responses/SkyBlockProfileGet'
        '400':
          $ref: '#/components/responses/DataMissing'
        '403':
          $ref: '#/components/responses/InvalidKey'
        '422':
          $ref: '#/components/responses/MalformedData'
        '429':
          $ref: '#/components/responses/RateLimited'
      security:
        - ApiKey: [ ]
      tags:
        - SkyBlock
  /v2/skyblock/profiles:
    get:
      parameters:
        - in: query
          name: uuid
          schema:
            format: uuid
            type: string
      responses:
        '200':
          $ref: '#/components/responses/SkyBlockProfilesGet'
        '400':
          $ref: '#/components/responses/DataMissing'
        '403':
          $ref: '#/components/responses/InvalidKey'
        '422':
          $ref: '#/components/responses/MalformedData'
        '429':
          $ref: '#/components/responses/RateLimited'
      security:
        - ApiKey: [ ]
      tags:
        - SkyBlock
  /v2/status:
    get:
      parameters:
        - in: query
          name: uuid
          required: true
          schema:
            type: string
      responses:
        '200':
          $ref: '#/components/responses/StatusGet'
        '400':
          $ref: '#/components/responses/DataMissing'
        '403':
          $ref: '#/components/responses/InvalidKey'
        '429':
          $ref: '#/components/responses/RateLimited'
      security:
        - ApiKey: [ ]
      summary: The current online status of a specific player
      tags:
        - Player Data
servers:
  - url: https://api.hypixel.net